import React from "react";
import Header from "./components/header/Header.jsx";
import background from "./assets/background-homepage.png";
import Homepage from "./components/homepage/Homepage.jsx";

const App = () => {
  return (
    <>
      <div className="h-[100vh] w-full relative overflow-hidden">
        <img className="absolute" src={background} alt="background" />
        <div className="w-full fixed bg-white bg-opacity-20">
          <Header />
        </div>
        <div className="relative h-full w-full px-1">
          <Homepage />
        </div>
      </div>
    </>
  );
};

export default App;
